import React, { Component } from 'react';

import './App.css';
import './Style/style.css';
// import Routess from './route';


class App extends Component {
  onClick = () => {
    console.log(this.firstname);
  }
  onKeyUp = (e) => {
    if (e.KeyCode == 13) {
      return this.lastname
    }
  }
  render() {
    return (
      <div>
        <div>
          <span>firstname</span>
          <input ref={(input) => { this.firstname = input }}
            onKeyUp={this.onKeyUp}
            type="text" />
        </div>
        <div>
          <span>lastname</span>
          <input type="text" ref={(input) => { this.lastname = input }} />
        </div>
        <div>
          <span>age</span>
          <input type="text" ref={(input) => { this.age = input }} />
        </div>
        <input type="submit" value="submit" ref={(input) => { this.submit = input }} onClick={this.onClick} />
      </div>
    );
  }
}

export default App;


